import React from 'react'
import { useDataContext } from '../hooks/useDataContext'

const Show_tmp = ({datalog}) => {

    const { dispatch } = useDataContext()

    const handclick = async () => {
    const response = await fetch('/api/datalog/' + datalog._id, {
      method: 'delete'
    })
    const json = await response.json()

    if (response.ok) {
      dispatch({type: 'deleteData', payload: json})
    }
  }

  return (
    <div className='data-list'>
        {datalog.map((d) => (
            <div>
                <p>Register id: {d.id}</p>
                <p>Name: {d.name}</p>
                <p>Facility: {d.facility}</p>
                <p>Issue: {d.issue}</p>
                <button onClick={handclick}>X</button>
            </div>
        ))}
    </div>
  )
}

export default Show_tmp
